var hiredis = require("./hiredis");

var start = new Date;
var parser = new hiredis.Reader({ return_buffers: false });
var i, j;

var feed = "*10\r\n";
for (i = 0; i < 10; i++) {
    feed += "*10\r\n";
    for (j = 0; j < 10; j++) {
        feed += "$10\r\nxxxxxxxxxx\r\n";
    }
}

for (i = 0; i < 10000; i++) {
    parser.feed(feed);
    parser.get();
}

var time = ((new Date)-start);
console.log("Took: " + time);

